import React from "react";
import NavDropdown from "react-bootstrap/NavDropdown";


const NavDropdownItemFlavor = (props) => {
    return (
        <NavDropdown.Item style={{textAlign: "center"}} href={"/"+props.name}>
            <img className={"flavor-image"} src={"../images/"+props.img} alt={props.alt}/>
            {props.name}    
        </NavDropdown.Item>
    );
};


export default NavDropdownItemFlavor;
